    """Return True is list elements are monotonically increasing or decreasing.
    >>> monotonic([1, 2, 4, 20])
    True
    >>> monotonic([1, 20, 4, 10])
    False
    >>> monotonic([4, 1, 0, -10])
    True
    """
    # Check if the list is empty
    if len(l) == 0:
        return False

    # Check if the list is only one element
    if len(l) == 1:
        return True

    # Check if the list is two elements
    if len(l) == 2:
        return l[0] == l[1]

    # Check if the list is increasing
    if l[0] <= l[1]:
